import React from 'react'

function Test() {
    return (
        <div>
            <div>
            <button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal">
                Launch demo modal
            </button>
            </div>
        </div>
    )
}

export default Test
